import React from 'react'
import { Button, Input } from 'antd'
import { SearchOutlined } from '@ant-design/icons'
const SearchButton = (props) => {
   const {size, placeholder, labelButton, backgroundButton='00B207'} = props
   return (
      <div style={{display: 'flex', fontFamily: 'Poppins'}}>
            <Input prefix={<SearchOutlined/>} size={size} placeholder={placeholder} style={{borderRadius: '6px 0px 0px 6px'}}/>
            <Button style={{background:backgroundButton, color:'white',borderRadius: '0px 6px 6px 0px', fontFamily: 'Poppins'}} size={size} >{labelButton}</Button>
      </div>
   )
}

export default SearchButton
